import React from 'react'
import Link from 'next/link'
import { inject, observer } from 'mobx-react'


@inject('store')
@observer

class Mob extends React.Component {
  componentDidMount() {
    console.log(this.props.store.movielist)
  }

  componentWillUnmount() {
    this.props.store.stop()
  }

  render() {
    return (
      <div className="container">
        <center>
          <div className="row">
              {this.props.store.movielist.map((movie, index) => <Card key={index} movie={movie}/> )}
          </div>
        </center>
      </div>
    )
  }
}

export default Mob;
